import React, { useState,  } from 'react';
import '../styles/About.css';

const About = () => {
  const [activeSection, setActiveSection] = useState('mission');

  return (
    <div className="about-wrapper">
      {/* Hero Section */}
      <section className="about-hero">
        <div className="hero-content">
          <div className="hero-text">
            <h1>Transforming Digital <span className="gradient-text">Possibilities</span></h1>
            <p>We're a passionate team dedicated to empowering businesses through innovative technology solutions</p>
          </div>
          <div className="hero-visual">
            <div className="hero-shapes">
              <div className="shape shape-1"></div>
              <div className="shape shape-2"></div>
              <div className="shape shape-3"></div>
            </div>
          </div>
        </div>
      </section>

      {/* Story Navigation */}
      <section className="story-navigation">
        <div className="nav-buttons">
          {[
            { id: 'mission', label: 'Our Mission' },
            { id: 'team', label: 'Our Team' },
            { id: 'journey', label: 'Our Journey' }
          ].map((section) => (
            <button 
              key={section.id}
              className={`nav-button ${activeSection === section.id ? 'active' : ''}`}
              onClick={() => setActiveSection(section.id)}
            >
              {section.label}
            </button>
          ))}
        </div>
      </section>

      {/* Dynamic Content Sections */}
      <section className="about-content">
        {activeSection === 'mission' && (
          <div className="mission-section">
            <div className="section-header">
              <h2>Our <span className="gradient-text">Mission</span></h2>
              <p>Bridging technology and business growth through innovative solutions</p>
            </div>
            <div className="mission-grid">
              {[
                {
                  icon: "🚀",
                  title: "Innovation",
                  description: "Pushing boundaries of digital transformation"
                },
                {
                  icon: "💡",
                  title: "Creativity",
                  description: "Solving complex problems with unique approaches"
                },
                {
                  icon: "🤝",
                  title: "Partnership",
                  description: "Collaborative growth with our clients"
                }
              ].map((value, index) => (
                <div key={index} className="mission-card">
                  <div className="mission-icon">{value.icon}</div>
                  <h3>{value.title}</h3>
                  <p>{value.description}</p>
                </div>
              ))}
            </div>
          </div>
        )}

        {activeSection === 'team' && (
          <div className="team-section">
            <div className="section-header">
              <h2>Meet Our <span className="gradient-text">Innovators</span></h2>
              <p>A diverse team of experts passionate about digital excellence</p>
            </div>
            <div className="team-grid">
              {[
                {
                  name: "Elena Rodriguez",
                  role: "Founder & CEO",
                  bio: "Visionary leader with 15 years of tech entrepreneurship",
                  skills: ["Strategy", "Innovation", "Leadership"]
                },
                {
                  name: "Michael Chen",
                  role: "CTO",
                  bio: "Technical architect driving technological innovation",
                  skills: ["Cloud", "AI", "Architecture"]
                },
                {
                  name: "Sarah Thompson",
                  role: "Head of Marketing",
                  bio: "Growth expert with a passion for digital strategies",
                  skills: ["Marketing", "Branding", "Growth"]
                },
                {
                  name: "David Kim",
                  role: "Creative Director",
                  bio: "Design visionary transforming digital experiences",
                  skills: ["UX/UI", "Branding", "Innovation"]
                }
              ].map((member, index) => (
                <div key={index} className="team-member">
                  <div className="member-avatar">
                    <div className="avatar-wrapper">
                      <div className="avatar-overlay"></div>
                    </div>
                  </div>
                  <div className="member-details">
                    <h3>{member.name}</h3>
                    <p className="member-role">{member.role}</p>
                    <p className="member-bio">{member.bio}</p>
                    <div className="member-skills">
                      {member.skills.map((skill, skillIndex) => (
                        <span key={skillIndex} className="skill-tag">{skill}</span>
                      ))}
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        )}

        {activeSection === 'journey' && (
          <div className="journey-section">
            <div className="section-header">
              <h2>Our <span className="gradient-text">Journey</span></h2>
              <p>A story of growth, innovation, and digital transformation</p>
            </div>
            <div className="timeline">
              {[
                {
                  year: 2020,
                  title: "Founding",
                  description: "Launched with a vision to democratize digital solutions"
                },
                {
                  year: 2021,
                  title: "First Milestone",
                  description: "Served 50+ clients, refined our service model"
                },
                {
                  year: 2022,
                  title: "Tech Expansion",
                  description: "Introduced AI and cloud-native solutions"
                },
                {
                  year: 2023,
                  title: "National Recognition",
                  description: "Awarded 'Innovative Tech Partner of the Year'"
                },
                {
                  year: 2024,
                  title: "Continued Growth",
                  description: "Expanding services, team, and global reach"
                }
              ].map((milestone, index) => (
                <div key={index} className="timeline-item">
                  <div className="timeline-marker"></div>
                  <div className="timeline-content">
                    <div className="timeline-year">{milestone.year}</div>
                    <h3>{milestone.title}</h3>
                    <p>{milestone.description}</p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        )}
      </section>

      {/* Call to Action */}
      <section className="about-cta">
        <div className="cta-content">
          <h2>Ready to <span className="gradient-text">Transform</span> Your Business?</h2>
          <p>Let's discuss how we can drive your digital success</p>
          <div className="cta-buttons">
            <button className="primary-btn">Schedule Consultation</button>
            <button className="secondary-btn">View Services</button>
          </div>
        </div>
      </section>
    </div>
  );
};

export default About;
